import React from 'react';
import { Profile } from './Profile.js';
import nba from 'nba';

windows.nba = nba;

export class Main extends React.Component {
    render() {
        return (
            <div className="main">
                <Profile />
                <div >ShotChart</div>
            </div>
        );
    }
}
